        "aboutUs": MessageLookupByLibrary.simpleMessage(
            "من نحن – مندوب مبيعات\nتطبيق مندوب مشتريات هو وسيط موثوق بين المصانع وتجار الجملة مع تجار التجزئة و أصحاب المنشآات و المؤسسات حيث يقدم تطبيقنا منصة لعرض المنتجات ولقاء الموردين في فضاء رقمي وعملي بالكامل، وقد سعت شركتنا مند تأسيسها على توفير منصة سهلة الاستخدام ليخدم جميع المستخدمين سواء من التجار المبتدئين او الكبار وحتى ملاك المصانع، كما توفر منصتنا تقديم خدمات أخرى من بينها الدفع الالكتروني والتواصل وحتى بناء علاقات احترافية بين التجار.\nويوفر تطبيقنا أيضا خدمة الإعلان والترويج داخل التطبيق لمن يريد ترويج منتجاته والوصول الى الفئة المستهدفة بسهولة وسرعة دون تنافس مع باقي المستخدمين.\nونحن نسعى مند انطلاقتنا على التميز بتقديم تطبيق بأحدث المعايير التكنولوجية والبرمجية لتسهيل عرض المنتجات والتواصل بين البائع والمشتري والأداء الرقمي بوسائل دفع متنوعة لكل المستخدمين حيث يعمل تطبيقنا على حث كلا الطرفين سواء البائع او المشتري على اتباع قواعد وقوانين محددة لاستخدام منصتنا من شأن هذه القواعد ضمان حقوق كلا الطرفين وتسهيل عملية البيع والشراء.\nولم يكن لنا ان نحصد هذا النجاح الا بدعم وثقة عملائنا، ولأن لديهم دائما الرغبة المستمرة في التميز فنسعى دائما لتطوير التطبيق بكل ما هو جديد ومواكب لتلبية طموحات عملائنا.\n \nقيمنا\nايمانا منا بأهمية التحول الرقمي الذي تعرفه المملكة السعودية قمنا بتصميم تطبيق الكتروني يجعل من تقديم خدمات البيع والشراء عملية رقمية بالكامل، وتجربة فريدة ومميزة لكافة المواطنين، حيث سيجد المشتري في تطبيقنا التنوع في العروض والسهولة في اختيارها والبحث عنها، كما سيجد البائع جميع الخصائص التي ستسهل عليه عرض منتجاته عبر فئات تقسم المنتجات حسب نوعها، فقد بذل طاقم تطبيق مندوب مشتريات جهده لجعل التطبيق بأعلى قدر من الأمان وسهولة الاستخدام الممكنة لراحة عملائنا.\n\n  \nاستراتيجيتنا\nيحث تطبيقنا على تقديم وعرض المنتجات بكل شفافية ووضوح مع الأخذ بالاعتبار ذكر كافة التفاصيل عن المنتج المراد بيعه، كما يحت المهتمين بالشراء الجادين فقط على الالتزام الفعال مع أصحاب المصانع وتجار الجملة  بما فيه منفعة لكلا الطرفين.\nومن ضمن اهدافنا ايضا جعل تطبيق مندوب مشتريات عنوانا للتميز والجودة وايضا سهولة الاستخدام لذلك سنعمل على الاشراف الدقيق على كل المنتجات التي يتم طرحها على منصتنا وعلى تقديم تجربة مستخدم جيدة من خلال الاعتماد على  واجهة سهلة الاستخدام User Friendly تتيح لزوارنا التنقل بين ارجاء التطبيق بسهولة، بالإضافة الى ان تطبيقنا Responsive  أي قابل للعرض على كافة الأجهزة سواء الموبايل او التابلت، وما يميز تطبيقنا أيضا هو التواصل المستمر مع المستعملين سواء عبر صفحة اتصل بنا والتي يمكن للجميع استعمالها للوصول الينا او عبر صفحاتنا في مواقع التواصل الاجتماعي مما يجعل موقعنا مواكبا لاهتمامات زوراه الكرام وهو ما يطلق عليه أيضا User Feedback.\n\n\nكيف يمكنني استخدام تطبيق مندوب مبيعات؟\n تفضل بتحميل التطبيق عبر متاجر التطبيقات الرسمية الاب ستور او الجوجل بلاي، تم قم بتسجيل حساب على تطبيقنا في حال كنت مهتم بالبيع او الشراء \n\nتواصل معنا \nتطبيق مندوب مبيعات بالمملكة العربية السعودية\n•\tالمملكة العربية السعودية , جدة , شارع الأمير سلطان , برج رانيا\n•\tmandoobquick@gmail.com\n•\t0122330005\n"),
