        "contract": MessageLookupByLibrary.simpleMessage(
            "تمهيد/ حيث أن الطرف الأول متخصص في مجال التسويق الالكتروني على شبكة الانترنت ومرخص له بمزاولة التسويق الالكتروني للسلع والمنتجات والخدمات ويمتلك القدرة البشرية والامكانيات بشقيها المالي والتقني المتمثل في الأدوات والوسائل التسويقية من خلال تطبيق مندوب مشتريات  الالكتروني،  وحيث أن الطرف الثاني أبدى استعداده للقيام بالعمل والتسوق نيابة عن الغير وإتمامه وفقاً للشروط المتفق عليها، وعليه فقد تلاقت ارادة الطرفين وهما بكامل اهليتهما الكاملة للتعاقد واتفقا على ما يلي: \n\nالبند الأول/ يعتبر التمهيد والمرفقات و الملاحق جزء لا يتجزأ من العقد ومكمل ومفسر لها\n\nالبند الثاني/التزامات الأطراف\n١- يلتزم الطرف الاول  بخدمة التسويق والنقل نيابة عن الغير داخل المدن دون تحمل الطرف الثاني  أي تكلفة وتكون تكلفة التسوق والنقل على العميل.\n٢- يلتزم الطرف الاول  بضمان المنتجات عند استلامها والحفاظ عليها وتوصيلها للعميل.\n٣- يلتزم الطرف الأول بتزويد الطرف الثاني الخطة التسويقية بما يخص نشاطه التجاري من خطة التسويق العامة والتي اعدتها ادارة التطبيق لجميع النشاطات الموجودة في التطبيق.\n٤- يلتزم الطرف الاول  بخدمات العملاء   وذلك بالرد على استفسارات العملاء وتلقي الشكاوى والملاحظات ونقلها للطرف الثاني إذا كانت بأحد الخدمات المقدمة في التطبيق، كما يحق للطرف الأول في حال عدم تجاوب الطرف الثاني مع شكاوى العملاء المرسلة له من قبل الطرف الاول  والمتعلقة بأحد الخدمات المتعلقة بالتطبيق التدخل وحل المشكلة مهما كانت ثم الرجوع على الطرف الثاني بأي مبالغ مالية دفعت للعميل في سبيل حل المشكلة.\n٥- يلتزم الطرف الثاني بعملية التأكد من صحة المنتجات والبضائع واستلام فاتورة الكترونية    .\n\nالبند الثالث: النسب المترتبة على العقد :\n١- اتفق الطرفان على ان يحصل الطرف الاول على سعر السلعة بسعر مخفض ويحق للطرف الاول اضافة اتعابه بحسب مايراه مناسبا لتكلفة التسويق والتوصيل   على كل عملية بيع تتم عن طريقة التطبيق   .\n \n\n\nالبند الرابع: مدة العقد :\nاتفق الطرفان ان تكون مدة العقد هي سنة ميلادية تبدا من تاريخ توقيع العقد. \n \n\nالبند الخامس/ فسخ العقد:\nيحق للطرف الأول فسخ هذا العقد في الحالات التالية :\n1-\tاذا قصر الطرف الثاني او اخل بأي شرط من شروط العقد.\n2-\tاذا أظهر الطرف الثاني بطئاً في تنفيذ هذا العقد بصورة تنبئ بأنه لن يستطيع إتمام العقد  .\n3-\tاذا ارتكب الطرف الثاني او من ينوب عنه شيئاً من قبيل الغش.\n\nالبند السادس: تسوية الخلافات :\nيكون هذا العقد خاضع للأنظمة المعمول بها في المملكة العربية السعودية ، و يتم حل أي نزاع ينشأ فيما  يتعلق بتفسير أي بند من بنوده بالطرق الودية ، فاذا تعذر ذلك فيحال النزاع الى جهات الاختصاص بمحافظة جدة.\n\nالبند السابع: القوة القاهرة:\nلا يتحمل طرفي هذا العقد قبل بعضهم البعض أية مسؤولية تترتب على عدم تنفيذ التزاماتهما الواردة بهذا العقد وملاحقه اذا تعرضا (لا قدر الله) لأضرار جسيمة ناتجة عن قوة قاهرة أو كوارث طبيعية أو حوادث طارئة أو الأوامر النظامية التي تؤدي الى تعطيل العمل كلياً أو جزئياً بمدينة جدة بشكل يتعذر الإستمرار في العمل بمعنى أن عدم التنفيذ أو التأخير في الالتزام يرجع لقوة قاهرة او حادث فجائي خارج عن إرادة الطرفين.\n\nالبند الثامن:التعديلات على العقد:\nلا يجوز لأي من الطرفين تعديل أو تغيير أو حذف أي بند من بنود هذا العقد وملاحقه ومستنداته بأي حال من الأحوال إلا إذا نُظم لهذا الغرض ملحقاً موقع عليه من قبل الطرفين أو من ينوب عنهما بموجب وكالة شرعية أو تفويض مصدّق من الجهات المختصة، وأي تعديل أو تغيير في بنود هذا العقد وملاحقه يكون غير ملزم لأي طرف لم يقم بالتوقيع عليه.\n\nالبند التاسع : الإخطارات:\nاختار كل طرف عنوانه الموضح بمقدمة هذا العقد كموطن مختار له وأي إخطارات أو مراسلات تتم عن طريق التطبيق او الايميل  أو تطبيق الواتس اب   يرسلها أي من الطرفين للآخر على عنوانه الموضح أعلاه تكون محققة لمضمونها ومؤكدة لاستلامها .\nالبند العاشر: سرية المعلومات: \n١- اتفق الطرفان على ان تكون جميع انواع البيانات والمعلومات المتداولة بين الطرفين تمتاز بالخصوصية وتم التعامل معها على هذا الأساس.\n٢- لا تستخدم البيانات والمعلومات إلا في الأغراض المنصوص عليها بهذا العقد وليس مصرحاً بتداولها خارج حدود الطرفين الموقعين على هذا العقد .\n"),
